import React from 'react'
import { H1, BodyMain } from '../../styles/TextStyles';
import { Card } from '../../styles/CardStyles';
import styled from 'styled-components'

function Home() {
    return (
        <>
            <Wrapper>

                <Bulb1 src="./Vector.svg" />
                <Bulb2 src="./Vector2.svg" />
                <ContentWrapper>
                    <TitleWrapper>
                        <ComputerWork src="./computer-work.svg" />
                        <TextWrapper>    
                            <Title>Hi.<br/>Welcome to<br/>My Website!</Title>
                        </TextWrapper>
                    </TitleWrapper>
                    <InfoCard>
                        <h2>
                            sadasd
                        </h2>
                    </InfoCard>
                </ContentWrapper>
            </Wrapper>
        </>
    )
}

export default Home;

const Wrapper = styled.div`
    height: 100%;
`

const InfoCard = styled(Card)`
    position: absolute;
    width: 1024px;
    margin: auto;
    width: 50%;
    border: 3px solid green;
    padding: 10px;
`

const ComputerWork = styled.img`
    width: 568px;
    height: 420px;
    left: calc(50% - 568px/2 - 202.5px);
    justify-content: center;
    align-content: center;
`

const W = styled.div`

`

const Bulb1 = styled.img`
    position: absolute;
    left: 0%;
    top: 0%;
    width: 100%;
    z-index: -10;
`
const Bulb2 = styled.img`
    position: absolute;
    left: 0%;
    top: 0%;
    width: 100%;
    z-index: -100;
`

const ContentWrapper = styled.div`
    max-width: 1234px;
    margin: 0 auto;
    padding: 200px 30px;
`

const TitleWrapper = styled.div`
    display: grid;
    position: realtive;
    grid-column-gap: 20px;
    grid-template-columns: 50% 50%;

`
const TextWrapper = styled.div`
    max-width: 360px;
    display: grid;
    grid-gap: 30px;
    justify-content: center;
    align-content: center;
`

const Description = styled(BodyMain)``

const Title = styled(H1)`
    color: white;
`
